import React from 'react';
import PropTypes from 'prop-types';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "./InputText.scss";
import useForm from '../../customhook/useForm';
InputText.propTypes = {};

function InputText(props) {
  const { error, setValue } = useForm();
  console.log();
  return (
    <div className="InputText">
      <div className="ContainerInput InputInvalid">
        <div className="Input">
          <input
            type="text"
            name="name"
            placeholder="Họ và Tên"
            onChange={(event) => setValue(event.target.value)}
          />
          <FontAwesomeIcon className="IconValid" icon="check" />
        </div>
        <div className="Error">
          <FontAwesomeIcon className="IconInvalid" icon="exclamation-circle" />
          <span>error error error error error error error error</span>
        </div>
      </div>
    </div>
  );
}


export default InputText;
